import React,{Component} from 'react';
import './App.css';
import Person from './Person/Person';
class App extends Component {
  render(){
  return (
    <div className="App">
      <h1>i am hamidreza</h1>
      <button>switch name </button>
      <Person name="ali" age="19"></Person>
      <Person name="reza" age="24"></Person>
      <Person name="hamid" age="26"></Person>
    </div>
  );
  }
}

export default App;
